(window.webpackJsonp=window.webpackJsonp||[]).push([[389],{3394:function(a){a.exports=JSON.parse('{"click-instruction":"Kliknij na pozycj\u0119 w menu, aby dowiedzie\u0107 si\u0119 wi\u0119cej na jej temat...","data-explorer-p1":"Eksplorator danych ISLE pozwala na analiz\u0119 zbior\xf3w danych za pomoc\u0105 interfejsu typu \\"wska\u017c i kliknij\\". Eksplorator danych jest podzielony na dwie szyby, lew\u0105, w kt\xf3rej mo\u017cna prze\u0142\u0105cza\u0107 si\u0119 pomi\u0119dzy widokiem arkusza kalkulacyjnego danych do analizy a innymi opcjonalnymi komponentami, takimi jak edytor zapisu raport\xf3w lub lista pyta\u0144. Po prawej stronie znajduje si\u0119 okienko wyj\u015bciowe, kt\xf3re zawiera wszystkie utworzone dane wyj\u015bciowe (statystyki podsumowuj\u0105ce, wykresy, wyniki testu hipotez).","data-explorer-p2":"Nowe wyj\u015bcia mo\u017cna wygenerowa\u0107 poprzez Toolbox, kt\xf3ry mo\u017cna otworzy\u0107 klikaj\u0105c na przycisk \\"Show Toolbox\\". Nowo wygenerowana dzia\u0142ka lub tabela zostanie do\u0142\u0105czona do listy element\xf3w wyj\u015bciowych pokazanych po prawej stronie.","data-explorer-p3":"Czerwone przyciski z ikonami \\"x\\" mog\u0105 by\u0107 u\u017cywane do usuwania poszczeg\xf3lnych element\xf3w wyj\u015bciowych, natomiast przycisk \\"Clear All\\" na dole usuwa wszystkie elementy wyj\u015bciowe.","data-explorer-p4":"U\u017cycie przycisk\xf3w ze znakiem zapytania w arkuszu danych, edytorze raport\xf3w lub w zestawie narz\u0119dzi pozwoli na rozpocz\u0119cie zwiedzania z przewodnikiem po mo\u017cliwo\u015bciach poszczeg\xf3lnych element\xf3w.","data-explorer-title":"Data Explorer","data-table-p1":"Prosty spos\xf3b wy\u015bwietlania danych w ISLE polega na wykorzystaniu tabeli danych. Pojawiaj\u0105 si\u0119 one w typowym formacie do przegl\u0105dania danych, podobnym do tego, jak dane wygl\u0105daj\u0105 w arkuszu kalkulacyjnym Excela. Ka\u017cda kolumna jest zmienn\u0105 z nazw\u0105 zmiennej na g\xf3rze.","data-table-p2":"Aby zwiedzi\u0107 z przewodnikiem to, co mo\u017cna zrobi\u0107 z tabelami danych, kliknij przycisk Poka\u017c samouczek (znak zapytania w prawym g\xf3rnym rogu tabeli danych).","data-table-title":"Tabela danych","documentation":"Dokumentacja","download-pdf":"Pobierz plik PDF","questions-p1":"Wiele z lekcji na ISLE, nad kt\xf3rymi b\u0119dziesz pracowa\u0142, b\u0119dzie zawiera\u0142o pytania, na kt\xf3re b\u0119dziesz m\xf3g\u0142 odpowiedzie\u0107. Istnieje wiele mo\u017cliwych typ\xf3w pyta\u0144, od kr\xf3tkich odpowiedzi do wielokrotnego wyboru. Oto przyk\u0142ad kr\xf3tkiej odpowiedzi na pytanie:","questions-p2":"Sk\u0142adanie wniosk\xf3w","questions-p3":"Gdy ju\u017c odpowiedzia\u0142e\u015b na pytanie i jeste\u015b gotowy do przes\u0142ania odpowiedzi, kliknij przycisk \\"Prze\u015blij\\". Zapisuje on Twoj\u0105 prac\u0119, aby Tw\xf3j instruktor m\xf3g\u0142 zobaczy\u0107 Twoj\u0105 odpowied\u017a i wyrazi\u0107 uznanie dla Twojego pytania.","questions-p4":"Przyciski sprz\u0119\u017cenia zwrotnego (Feedback Buttons)","questions-p5":"Czasami instruktor mo\u017ce umie\u015bci\u0107 przyciski informacji zwrotnej (pokazane powy\u017cej) na poszczeg\xf3lnych pytaniach. Lewy przycisk pozwala zauwa\u017cy\u0107, \u017ce jeste\u015b zdezorientowany w pytaniu; \u015brodkowy przycisk pozwala zauwa\u017cy\u0107, \u017ce pytanie ma sens; a prawy przycisk pozwala na bardziej szczeg\xf3\u0142owe komentarze zwrotne.","questions-p6":"Pytania nawigacyjne","questions-p7":"Kilka pyta\u0144 mo\u017ce by\u0107 umieszczonych w tym samym miejscu na stronie. W takim przypadku mo\u017cna porusza\u0107 si\u0119 pomi\u0119dzy pytaniami klikaj\u0105c przycisk \\"Dalej\\" lub wybieraj\u0105c pytania wed\u0142ug numer\xf3w:","questions-title":"Pytania","statusbar-p1":"Klikni\u0119cie na pasku stanu spowoduje wy\u015bwietlenie przycisk\xf3w umo\u017cliwiaj\u0105cych za\u0142o\u017cenie konta ISLE lub zalogowanie si\u0119 do istniej\u0105cego. Na \u015brodku paska stanu znajduje si\u0119 wy\u015bwietlona nazwa u\u017cytkownika lub osoba zalogowana. Po najechaniu na niego wy\u015bwietli si\u0119 kilka statystyk dotycz\u0105cych post\u0119p\xf3w w nauce: czas sp\u0119dzony na lekcji, procent zaj\u0119\u0107 wykonanych na danej lekcji oraz og\xf3lne punkty osi\u0105gni\u0119\u0107.","statusbar-title":"Statusbar"}')}}]);